import { ReactComponent as Time } from "../../assets/img/time.svg";
import { ReactComponent as Money } from "../../assets/img/money.svg";
import { useNavigate } from "react-router-dom";
import { getHours } from "../../utils/getHours";
import ScaleOnline from "../Footer/ScaleOnline";

interface CaseProps {
  id?: string;
  title: string;
  cost: number;
  costType: string;
  tags?: string[];
  rating: number;
  text?: string;
  isShowPrice?: boolean;
}
const User = ({
  title,
  cost,
  costType,
  text,
  rating,
  isShowPrice = false,
}: CaseProps) => {
  const navigate = useNavigate();

  return (
    <div className="box-case">
      <div className="header-box-user">
        <span>{title}</span>
        <ScaleOnline rating={rating} maxPlayers={5} />
      </div>

      <div className="body-box-case">
        <div className="box-specializations">
          <p className="case-specialization">
            Мобильные приложения fdslkfmkdlsmf dsfmakdlsmfklsd fdsmfkldsmfkla
            fdsmfklds
          </p>
        </div>

        {isShowPrice && (
          <div className="box-price">
            <Money />
            <p>
              {cost === null
                ? "договорная"
                : costType === "inOrder"
                ? cost + "р за проект"
                : cost + "р / в час"}
            </p>
          </div>
        )}
      </div>
      <button className="btn lightBtn" style={{ backgroundColor: "#805429" }}>
        СДЕЛАТЬ ИСПОЛНИТЕЛЕМ
      </button>
    </div>
  );
};

export default User;
